using System;
using Core.Utils.DB;
using JetBrains.Annotations;
using Moq;
using Xunit;
using Core.Config;
using Core.Utils.Security;
using Microsoft.Extensions.Logging;
using Microsoft.Extensions.Options;
using System.Net.Mime;

namespace CoreIntegrationTest.Utils.DB;

[TestSubject(typeof(FileCloudStorage))]
public class FileCloudStorageTest
{
    private readonly Mock<ILogger<FileCloudStorage>> _mockLogger;
    private readonly Mock<IVault> _mockVault;
    private readonly IOptions<FileStorageConfig> _options;

    public FileCloudStorageTest()
    {
        _mockLogger = new Mock<ILogger<FileCloudStorage>>();

        _options = Options.Create(new FileStorageConfig
        {
            BucketName = "bucket_name",
            Provider = "provider"
        });

        _mockVault = new Mock<IVault>();
        _mockVault.Setup(x => x.RevealSecret(It.IsAny<FileStorageConfig>()))
            .Returns(new FileStorageConfig
            {
                BucketName = "bucket-oneloan-los-alpha",
                Provider = "google"
            });
    }

    [Fact]
    public void Should_SaveToCloud_OnNormalFlow()
    {
        var fileCloudStorage = new FileCloudStorage(_mockLogger.Object, _options, _mockVault.Object);
        var base64String = GetImageBase64String();
        var exception = Record.Exception(()=> fileCloudStorage.SaveToCloud(base64String, "test_folder/test_subfolder", Guid.NewGuid().ToString() + ".jpg",MediaTypeNames.Image.Jpeg));
        
        Assert.Null(exception);
    }

    private static string GetImageBase64String()
    {
        return "";
    }
}